import classes from './Board.module.css'

const Board = (props) => {

    const array = [...props];
  return (
    <li className={classes.board}>
      <h2>{props.name}</h2>
      <h3>{props.article}</h3>
      <p>{array}</p>
    </li>
  );
};

export default Board;
